const PROPOSAL_STATUSES = {
  // Order
  PENDING: 0, // 0
  QUALIFIED: 3, // 1
  SCREENED: 4, // 2
  CONTACTED: 1, // 3
  DECLINED: 2, // 4
};

export default PROPOSAL_STATUSES;
